// SPDX-License-Identifier: MIT
pragma solidity >=0.4.22 <0.9.0;

library RouletteUtils {
  enum BetType {
    COLOUR,
    ODDEVEN,
    STRAIGHTUP
    /*
        HIGHLOW, 
        COLUMN, 
        DOZENS, 
        SPLIT, 
        STREET, 
        CORNER, 
        LINE, 
        FIVE, 
        BASKET, 
        SNAKE 
        */
  }

  struct Bet {
    address payable player;
    BetType bet_type;
    uint256 bet;
    uint256 bet_amount;
  }

  function make_bet(uint256 bet_type, uint256 bet, uint256 bet_amount) public view returns (Bet memory) {
    return Bet(payable(msg.sender), BetType(bet_type), bet, bet_amount);
  }

  // Note: Replace with chainlink
  function random(uint256 mod) public view returns (uint256) {
    return
      uint256(keccak256(abi.encodePacked(block.difficulty, block.timestamp))) %
      mod;
  }

  function is_red(uint256 roll) public pure returns (bool) {
    if (roll < 11 || (roll > 18 && roll < 29)) {
      // Red odd, black even
      return roll % 2 == 1;
    } else {
      return roll % 2 == 0;
    }
  }

  function get_winnings(Bet memory bet, uint256 roll)
    public
    pure
    returns (uint256)
  {
    // House edge, contract keeps the money
    if (roll == 0) {
      return 0;
    }

    if (bet.bet_type == BetType.COLOUR) {
      // 0 = red, 1 = black
      if (bet.bet == (is_red(roll) ? 0 : 1)) {
        return bet.bet_amount * 2;
      }
    } else if (bet.bet_type == BetType.ODDEVEN) {
      // 0 = even, 1 = odd
      if (bet.bet == (roll % 2)) {
        return bet.bet_amount * 2;
      }
    } else if (bet.bet_type == BetType.STRAIGHTUP) {
      if (bet.bet == roll) {
        return bet.bet_amount * 35;
      }
    }

    return 0;
  }
}
